import { ApplicationConfig } from '@angular/core';
import { provideRouter, Routes } from '@angular/router';
import { provideHttpClient } from '@angular/common/http'; // Import provideHttpClient
import { HomeComponent } from './pages/home/home.component';
import { MyKnowledgeComponent } from './pages/my-knowledge/my-knowledge.component';
import { FindAServiceComponent } from './pages/find-a-service/find-a-service.component';
import { MyHealthComponent } from './pages/my-health/my-health.component';
import { YourTipsComponent } from './pages/your-tips/your-tips.component';
import { MyFavouritesComponent } from './pages/my-favourites/my-favourites.component';
import { DynamicContentComponent } from './components/dynamic-content/dynamic-content.component';

const routes: Routes = [
  { path: '', redirectTo: 'home', pathMatch: 'full' },
  { path: 'home', component: DynamicContentComponent }, // Use DynamicContentComponent for home route
  { path: 'my-knowledge', component: MyKnowledgeComponent },
  { path: 'find-a-service', component: FindAServiceComponent },
  { path: 'my-health', component: MyHealthComponent },
  { path: 'your-tips', component: YourTipsComponent },
  { path: 'my-favourites', component: MyFavouritesComponent },
  // Add routes for specific content links if needed, e.g.,
  // { path: 'my-knowledge/health-records', component: HealthRecordsDetailComponent },
  { path: '**', redirectTo: 'home' } // Wildcard route for a 404-like behavior
];

export const appConfig: ApplicationConfig = {
  providers: [
    provideRouter(routes),
    provideHttpClient() // Add provideHttpClient here
  ]
};
